!function(){var countDown=new Date("Jul 1, 2019 00:00:00").getTime();setInterval(function(){var now=(new Date).getTime(),distance=countDown-now;document.getElementById("days").innerText=Math.floor(distance/864e5),document.getElementById("hours").innerText=Math.floor(distance%864e5/36e5),document.getElementById("minutes").innerText=Math.floor(distance%36e5/6e4),document.getElementById("seconds").innerText=Math.floor(distance%6e4/1e3)},1e3)}();